import React, { useState } from 'react';

import { Button } from 'primereact/button';
import { InputText } from 'primereact/inputtext';

import '../../styles/SignIn.css';

function SignIn() {
    const [mailId, setMailId] = useState('');
    const [password, setPassword] = useState('');

    return (
        <div className="sign-in-container">
            <div className="sign-in-div">
                <div className="p-d-flex p-text-center p-flex-wrap p-m-4">
                    <p className="welcome-text p-my-4">Welcome back!</p>
                    <div className="p-col-11">
                        <p className="p-text-left">Email</p>
                        <InputText value={mailId} onChange={(e) => setMailId(e.target.value)} />
                    </div>
                    <div className="p-col-11">
                        <p className="p-text-left">Password</p>
                        <InputText id="password" value={password} onChange={(e) => setPassword(e.target.value)} />
                    </div>
                    <div className="p-col-11 p-my-3">
                        <Button label="Sign in"></Button>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default SignIn
